angular.module("templatescache", []).run(["$templateCache", function($templateCache) {$templateCache.put("projects/project.html","<div class=\"masthead\"\n     style=\"background-image: url({{masthead}})\">\n  <div class=\"project-description\">\n    <h1 class=\"project-title\">{{ title }}</h1>\n  </div>\n</div>\n\n<div class=\"lightbox is-hidden\">\n  <button class=\"btn-close ripple\" data-ripple data-close-lightbox></button>\n  <ul class=\"lightbox\" rn-carousel rn-carousel-controls rn-carousel-index=\"currentArtwork\">\n    <li data-ng-repeat=\"photo in photos\">\n      <div class=\"lightbox-item\"></div>\n        <img src=\"{{ photo.bigUrl }}\" alt=\"\">\n      </li>\n  </ul>\n</div>\n\n<p class=\"project-abstract\"\n   ng-text-truncate=\"description\"\n   ng-tt-words-threshold=\"25\"></p>\n<h2 class=\"sub-title\">Arworks</h2>\n<ul class=\"artwork-list\">\n  <li data-ng-repeat=\"photo in photos\"\n      data-ripple\n      class=\"artwork-list-item ripple\">\n    <img src=\"{{photo.url}}\"\n         data-lightbox-trigger\n         data-current-index=\"{{$index}}\">\n  </li>\n</ul>\n");
$templateCache.put("projects/projects.html","<ul class=\"project-list fade\"\n    data-ng-class=\"{in:projects.length>7}\">\n  <li data-ng-repeat=\"project in projects | orderBy:predicate:reverse\"\n      class=\"project-list-item fade in\"\n      style=\"background-image:url({{project.thumb}});\n             -webkit-animation-delay:{{$index*100}}ms\">\n    <a class=\"project-list-link ripple\" data-ripple data-ripple-speed=\"100\" ui-sref=\"projectDetail({ id: project.id })\">\n      <h2 class=\"project-list-title\">{{project.title}}</h2>\n    </a>\n  </li>\n</ul>\n");}]);